const App = (props) =>{
    return(
        <>
            <div className="machine">
                <h1>welcome to role machine</h1>
                <h1> {props.x === props.y === props.z}</h1>? <h3>you are maching</h3>: <h3>you are not maching</h3>
                
            </div>
        </>
    )
}
export default App;
